import ChatHeader from './ChatHeader';

import { ChatStyled } from './styled';
import ChatMessages from './ChatMessages/ChatMessages';
import ChatInput from './ChatInput/ChatInput';

const Chat = ({ user }) => (
  <ChatStyled>
    <ChatHeader user={user} />
    <ChatMessages />
    <ChatInput />
  </ChatStyled>
);

export default Chat;
